import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'

import Login from './components/login_page/login';
import Home from './components/home_page/home';
import Product from './components/product_details_page/product';
import Cart from './components/cart_page/cart';
import Header from './components/base/header';

import { useSelector, useDispatch } from 'react-redux';
import {increment, decrement, login} from "./redux-components/actions";



function App() {
const counter = useSelector(state => state.counter);
const dispatch = useDispatch();
const isLogged = useSelector(state => state.logged);
const logoDispatch = useDispatch();

  return (
    <div className="App">
        <h1>Counter: {counter}</h1>
        <button onClick={() => dispatch(increment())}>+</button>
        <button onClick={() => dispatch(decrement())}>-</button>
        <button onClick={() => logoDispatch(login())}>See Hidden Text</button>
        {isLogged ? <h3>Valuable information I should not see.</h3> : ''}
