      {/*      <Route path={'/home'} component={ Home } />*/}
      {/*      <Route path={'/products_page'} component={ Product } />*/}
      {/*      <Route path={'/cart'} component={ Cart } />*/}
      {/*</BrowserRouter>*/}
    </div>
  );
}

export default App;
